const sidebarNav = [
    {
        link: '/',
        section: 'dashborad',
        icon: <i className='bx bx-home-alt'></i>,
        text: 'Dashborad'
    },
    {
        link: '/graph',
        section: 'graph',
        icon: <i className='bx bx-line-chart'></i>,
        text: 'Graph'
    },
    {
        link: '/model',
        section: 'model',
        icon: <i className='bx bx-landscape'></i>,
        text: '2Dmodel'
    },
    {
        link: '/reports',
        section: 'reports',
        icon: <i className='bx bx-cube'></i>,
        text: 'Reports'
    },
    {
        link: '/settings',
        section: 'settings',
        icon: <i className='bx bx-cog'></i>,
        text: 'Settings'
    }
]

export default sidebarNav
